import {Dropdown} from 'react-bootstrap'
import './navbar.css'
import {Link,Redirect} from 'react-router-dom'
import { useState } from 'react'
import Home from '../home'
import Navbar from './navbar'
import { useHistory } from "react-router-dom";

function NavbarLogin(){
  let history = useHistory();
  const isLogin= JSON.parse(sessionStorage.getItem("isLogin"));
  const logout=()=>{

    sessionStorage.setItem("isLogin", JSON.stringify(false));
    sessionStorage.setItem("Admin", JSON.stringify(false));
    history.push(<Navbar/>);
  }
  return(
  <div class = "navbar" >
        <div id = "nav-right" >
        <img src = { require("./assets/Icon.png").default } alt = "Icon" />
        </div> 
        <div id = "nav-left" >
        <Dropdown>
        <Dropdown.Toggle variant="success" id="dropdown-basic">
        <img id="user-img" src={require("./assets/user (1).png").default} alt="user"/>
        </Dropdown.Toggle>

        <Dropdown.Menu>
        <Dropdown.Item ><Link to="/profile">Profile</Link></Dropdown.Item>
          <Dropdown.Item ><Link to="/payment">Pay</Link></Dropdown.Item>
          <Dropdown.Item  onClick={logout}>Logout</Dropdown.Item>
        </Dropdown.Menu>
</Dropdown>
            
        </div>
  </div>)
}
export default NavbarLogin
